import React from 'react';
import { wordType } from "../types/selectedWords";

const WordSelectForm = (): JSX.Element => {
  const renderCheckboxes = (type: wordType) => {
    return (
      <div>
        {
          kinshipWords.map((word) => {
            return word;
          })
        }
      </div>
    );
  };

  return (
    <div>
      <div>
        <h3>
          Kinship
        </h3>

        {renderCheckboxes("kinship")}
      </div>
    </div>
  );
};

export default WordSelectForm;
